import React from "react";
import { useNavigate } from "react-router-dom";

function Home(){

const navigate = useNavigate();

return(

<div>

<h1>OLA</h1>

<input placeholder="Pickup"/>

<input placeholder="Drop"/>

<button onClick={()=>navigate("/map")}>
SEARCH OLA CABS
</button>

</div>

);

}

export default Home;
